import React from "react";
import "./Navbar.css";
import { ReactSVG } from "react-svg";
import {icon} from "../images/perplexity-icon.svg";

function Navbar() {
	return (
		<nav>
			<div className='first-part'>
				<div className='nav-item'>
					<ReactSVG src={icon} />
				</div>
				<div className='nav-item'>New Thread</div>
				<div className='nav-item'>Home</div>
				<div className='nav-item'>Discover</div>
				<div className='nav-item'>Library</div>
				<div className='nav-item'>Login</div>
				<div className='nav-item'>Sign Up</div>
			</div>
			<div className='second-part'>
				<div>TryPro</div>
				<div>
					Upgrade to Claude-2 or GPT-4, boost your Copilot uses, and upload more
					files.
				</div>
			</div>
		</nav>
	);
}

export default Navbar;
